qMeasure.qDef:
pick(match(KPI_ID, 10, 20, 30, 40, 50, 60, 70, 80, 90), 
//10
num( sum(DosesDistributed_Cumul), '#,##0;-#,##0;-'),

//20
num(100*median(aggr(nodistinct SUM(DosesDistributed_per100Inh_Cumul), [Member State])), '#,##0.0;-#,##0.0;-'),

//30
num(sum(DoseTotal_ALLP_Cumul), '#,##0'),

//40
num(sum(Uptake2nd_ALLP_Cumul), '0.0%'),

//50
num(sum(Uptake2nd_ALL_Cumul), '0.0%'),

//60
num(sum({<[Vaccination.TargetGroup]={"Age<18"}>} Uptake2nd_AGE_Cumul),  '0.0%;-0.0%;-'),

//70
num(rangemin(1, sum({<Uptake2nd_60_Cumul={">0"}>} Uptake2nd_60_Cumul)), '0.0%;-0.0%;-'),

//80
num(rangemin(1, sum({<Uptake2nd_HCW_Cumul={">0"}>} Uptake2nd_HCW_Cumul)), '0.0%;-0.0%;-'),

//90
num(rangemin(1, sum({<Uptake2nd_LTCF_Cumul={">0"}>} Uptake2nd_LTCF_Cumul)), '0.0%;-0.0%;-')
)
